INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 0, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", "春咲 ひより", 1, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 1.4, 0, 0, 2, 1001, "お！\nあそこに困ってそうな人発見！", 1, 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 0, "わ、わたし、\nなに言ってるんだろ\nあはは…", "草野 優衣", 1, "みんなみたいに\nわたしも強くならなきゃ", 1.4, 0, 0, 2, 1002, "大切な人を\n守れるようになりたい…って", 1, 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 0, "少しは磨かれると思いますよ。", "士条 怜", 1, "フェンシングを始めてみては？", 1.4, 0, 0, 2, 1003, "キミに必要な集中力と感性が", 1, 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 0, "みそぎはねぇ、\nかくれんぼやりたい！", "穂高 みそぎ", 1, "ねぇ、にいちゃん！", 1.5, 0, 0, 2, 1004, "今日はなにして遊ぶ？", 1, 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 0, "私といっしょに…\nいかない？", "風宮 あかり", 1, "風宮あかりです", 1.4, 0, 0, 2, 1006, "ねぇ…", 1, 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 0, "食べ物の恨みは怖いのー", "出雲 宮子", 1, "出雲宮子なのー", 1.5, 0, 0, 2, 1007, "プリンたべたいのー", 1, 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 0, "いいよ。\n見られることは運命さ…", "虹村 雪", 1, "ボクは虹村雪。", 1.4, 0, 0, 2, 1008, "キミもボクの美貌に\n吸い寄せられたんだね。", 1, 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 0, "人呼んで「疾風の冥姫」!!", "柊杏奈", 1, "フッ…聞いて後悔するがいい！", 1.4, 0, 0, 2, 1009, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 1, 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 0, "ほんまおおきにやわ～♪", "姫宮 真歩", 1, "マホマホ王国のプリンセス、\nまほ姫どす", 1.5, 0, 0, 2, 1010, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 1, 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 0, "ここで会ったが\n100年目～！", "衣之咲 璃乃", 1, "衣之咲璃乃です！", 1.4, 0, 0, 2, 1011, "生き別れたお兄ちゃんを探して\n三千世界！", 1, 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 0, "…って、お願い！\n誰にも言わないでおいて～！", "柏崎 初音", 1, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 1.4, 0, 0, 2, 1012, "ち、超能力って…\n何のことかな～？", 1, 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 0, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", "美波 鈴奈", 1, "ちょす！\n美波鈴奈だよ～♪", 1.4, 0, 0, 2, 1016, "一応カリスマ読モJKやってまっす！", 1, 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 0, "でも、沖縄もとってもいいとこさー", "喜屋武 香織", 1, "はいたーい。\n喜屋武香織さー。", 1.4, 0, 0, 2, 1017, "東京は遊園地みたいなところさー", 1, 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 0, "イオちゃんって呼んでね。", "支倉 伊緒", 1, "支倉伊緒です。", 1.4, 0, 0, 2, 1018, "先生って呼ばれるのは\nくすぐったいから", 1, 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 0, "ミミをおいてかないでぇ～", "茜 ミミ", 1, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 1.5, 0, 0, 2, 1020, "あ！/\お兄ちゃ～ん\nまってよ～", 1, 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 0, "ふぇぇぇぇぇん……", "栗林 くるみ", 1, "あ…あの…えっと…\n栗…林…くるみ…です……", 1.5, 0, 0, 2, 1021, "あの……\nふぇ……", 1, 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 0, "なんてありがとうございます！", "風宮 より", 1, "風宮よりです。\nあああああ！", 1.4, 0, 0, 2, 1022, "こんな私に貴重な時間を\n割いていただき、", 1, 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 0, "私こっち行きたいー\nね、早く早くー", "北条 綾音", 1, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 1.5, 0, 0, 2, 1023, "おにいちゃんどこいくの？\nえ？", 1, 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 0, "これて何か違う…\nあああすみません！", "天野 すずめ", 1, "わっ…わっ…私、\n天野すずめといいます！", 1.4, 0, 0, 2, 1025, "ふ、不束者ですが\nどうぞ末永く…って、", 1, 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 0, "離しませんわ………\n絶対に…!!", "倉石 恵理子", 1, "……クスクス…私は\n…倉石恵理子……", 1.4, 0, 0, 2, 1027, "あなたは…運命の……\n伴侶……", 1, 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 0, "…そうでしょ？？", "佐々木 咲恋", 1, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 1.4, 0, 0, 2, 1028, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 1, 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 0, "あはは、\n私もまだまだだなぁ～", "桜井 望", 1, "桜井望だよ！\nよろしくねっ", 1.4, 0, 0, 2, 1029, "ぇっと…\nキミ、私のこと知らないの?!", 1, 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 0, "ショーグン、\nワタシと一緒に天下統一デース！", "ニノン・ジュベール", 1, "デケデケデンっ！", 1.4, 0, 0, 2, 1030, "初めまして、\n私はニノン・ジュベール申すデス！", 1, 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 0, "おかしいですね……", "上喜 しのぶ", 1, "上喜しのぶです。\n手元のドクロが父です。", 1.4, 0, 0, 2, 1031, "でもって私の隣にいるのが……\nえ、見えない？", 1, 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 0, "そう、\nオラのボケに突っ込める相方が…！", "野戸まひる", 1, "目指すはビッグな\nお笑い芸人だっぺ！", 1.5, 0, 0, 2, 1033, "けんども\nそれには足りないモンが…", 1, 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 0, "ちょ\nちょっと一杯飲んできます…！", "綾瀬 ゆかり", 1, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 1.4, 0, 0, 2, 1034, "ちょっと緊張しちゃって…", 1, 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 0, "これ以上お話しすることは…\nないです！", "氷川 鏡華", 1, "氷川鏡華…です", 1.5, 0, 0, 2, 1036, "知らない人とは話しちゃいけないので", 1, 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 0, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", "柏崎 栞", 1, "柏崎…栞です。", 1.4, 0, 0, 2, 1038, "……あ、アラーム。", 1, 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 0, "野に咲く花が、\n唯一の話相手です。", "双葉 碧", 1, "ふ、双葉碧です。", 1.4, 0, 0, 2, 1040, "私、一人も友達がいなくて……", 1, 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 0, "そう思っています。", "三角 千歌", 1, "三角千歌です。", 1.4, 0, 0, 2, 1042, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 1, 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 0, "う、疑ってすまなかったな…", "安芸 真琴", 1, "安芸真琴だ。", 1.4, 0, 0, 2, 1043, "あぁ？\nお前のそいつの仲間か？", 1, 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 0, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", "イリヤ・オーンスタイン", 1, "わらわこそは夜を総べる者！", 1.4, 0, 0, 2, 1044, "生けとし生ける全ての者よ！", 1, 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 0, "ｌク、クウカに何かご用ですか!?", "遠見 空花", 1, "そこで騎士は妖精を乱暴に……", 1.4, 0, 0, 2, 1045, "ぐふふふふ……はっ！", 1, 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 0, "う～ん…\n猫ってホントに最高にゃ～♪", "宮坂たまき", 1, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 1.4, 0, 0, 2, 1046, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 1, 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 0, "…と思ったら\nバイトの時間だ！\nまたあとでね！", "大神 美冬", 1, "大神美冬よ！", 1.4, 0, 0, 2, 1048, "それでは早速クエストに…", 1, 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 0, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", "星野静流", 1, "星野静流だよ！", 1.4, 0, 0, 2, 1049, "クエストもバトルも\n掃除も洗濯も", 1, 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 0, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", "玉泉美咲", 1, "アタシは玉泉美咲。", 1.5, 0, 0, 2, 1050, "見ての通りの\nセクシー美少女で", 1, 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 0, "？？？？", "リマ", 1, "？？？", 1.4, 0, 0, 2, 1052, "？？？？", 1, 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 0, "そ、そこまでいうなら\nもらってやる", "モニカ・ヴァイスヴィント", 1, "モニカ・ヴァイスヴィントだ。", 1.5, 0, 0, 2, 1053, "菓子でつろうなどと\n稚拙な策を……", 1, 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 0, "そ、そこまでいうなら\nもらってやる", "ペコリーヌ", 1, "モニカ・ヴァイスヴィントだ。", 1.5, 0, 0, 2, 1058, "菓子でつろうなどと\n稚拙な策を……", 1, 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 0, "そ、そこまでいうなら\nもらってやる", "コッコロ", 1, "モニカ・ヴァイスヴィントだ。", 1.5, 0, 0, 2, 1059, "菓子でつろうなどと\n稚拙な策を……", 1, 0);
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 0, "そ、そこまでいうなら\nもらってやる", "キャル", 1, "モニカ・ヴァイスヴィントだ。", 1.5, 0, 0, 2, 1060, "菓子でつろうなどと\n稚拙な策を……", 1, 0);
